import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class ActivitiesService {

  constructor() { }
  getAll(): String[]{
    return[
      '\assets\images\act\Music.png',
      '\assets\images\act\Quote.png',
      '\assets\images\act\Video.png'
    ]
  }
}
